import React, {useState, useEffect} from "react";

function DungeonRoom() {

    const [enemy, setEnemy] = useState({})

    useEffect(() => {
        fetch("http://localhost:9292/enemy/rand")
        .then(res => res.json())
        .then(setEnemy)
    })
    return(
        <div>
            <h2>Enemy: {enemy.name} the {enemy.race}</h2>
        </div>
        )
}

export default DungeonRoom
